caveat.text:
About national population figures:  
				population figures for 1999 are from the 1990-1999 series of bridged-race intercensal estimates of the July 1 resident population; 
				population figures for 2000 and 2010 are bridged-race April 1 census counts;
				population figures for 2001-2009 are from the revised 2000-2009 series of bridged-race intercensal estimates of the July 1 resident population; 
				population figures for 2011 are bridged-race postcensal estimates of the July 1 resident population, 
				from the Vintage 2011  series  released by NCHS on July 18, 2012; 
				population figures for 2012 are bridged-race postcensal estimates of the July 1 resident population, 
				from the Vintage 2012  series  released by NCHS on June 13, 2013; 
				population figures for 2013 are bridged-race postcensal estimates of the July 1 resident population, 
				from the Vintage 2013  series  released by NCHS on June 26, 2014; 
				population figures for 2014 are bridged-race postcensal estimates of the July 1 resident population, 
				from the Vintage 2014  series  released by NCHS on June 30, 2015. 
				and
				population figures for 2015 are bridged-race postcensal estimates of the July 1 resident population, 
				from the Vintage 2015  series  released by NCHS on June 28, 2016. 

				#Population Information#

About sub-national population figures for regions, divisions, states and counties: 
				population figures for 1999 are from the 1990-1999 series of bridged-race intercensal estimates of the July 1 resident population; 
				population figures for 2000 and 2010 are bridged-race April 1 census counts; 
				population figures for 2001-2009 are from the revised 2000-2009 series of bridged-race intercensal estimates of the July 1 resident population;
				and 
				population figures for 2011-2015 are bridged-race postcensal estimates of the July 1 resident population, 
				from the Vintage 2015  series  released by NCHS on June 28, 2016.

